SELECT ?parentOfAmy ?actorInMovie WHERE {
  # Find the parent of Amy Arbus
  ?amyArbus a dbo:Person ;
            foaf:name "Amy Arbus" .

  ?parentOfAmy dbo:child ?amyArbus .

  # Find the child of Allan Arbus (likely Amy Arbus)
  ?allanArbus a dbo:Person ;
              foaf:name "Allan Arbus" .

  ?childOfAllan dbo:parent ?allanArbus .
  FILTER (?childOfAllan = ?amyArbus)

  # Find the movie where Herschel Bernardi acted
  ?movie dbo:starring ?herSchelBernardi ;
         dbo:actor ?actorInMovie .

  ?herSchelBernardi a dbo:Person ;
                    foaf:name "Herschel Bernardi" .
}
```

