  # Find the successor of the 2006–07 VfL Bochum season
  ?successor dbo:sportsTeam dbr:VfL_Bochum ;
             dbo:seasonStartYear ?startYear ;
             dbo:seasonEndYear ?endYear .

  FILTER (?startYear > 2006 || (?startYear = 2006 && ?endYear > 2007))

  # Find the sports club that is also an organization and a soccer club
  ?club dbo:sportsTeam dbr:VfL_Bochum ;
        rdf:type dbo:SoccerClub, dbo:Organization .

  # Get the manager of this club
  ?club dbo:manager ?manager .
}
```

