```sparql
PREFIX dbo: <http://dbpedia.org/ontology/>
PREFIX dbr: <http://dbpedia.org/resource/>

SELECT ?person ?partyMember ?birthName WHERE {
  # Find people who are members of the Republican Party (United States)
  ?partyMember a dbo:Person ;
              dbo:member dbr:Republican_Party_(United_States) .

  # Find Ann Sothern's birth name
  dbr:Ann_Sothern dbo:birthName ?birthName .

  # Check if there is any overlap between party members and people with the same birth name as Ann Sothern
  ?person a dbo:Person ;
          rdfs:label ?partyMemberLabel ;
          dbo:birthName ?birthName .
}
